import { Container } from "react-bootstrap";
import HostForm from "./HostForm";

function Host() {
  const isHost = localStorage.getItem("isHost");
  return (
    <>
      <Container>
        {isHost && <HostForm />}
        {!isHost && <p>details</p>}
      </Container>
    </>
  );
}
export default Host;
